import requestsfrom bs4 import BeautifulSoupfrom Classes.status import Statusfrom Classes.store import BaseStorefrom stores.WacomStore.wacomsotre_info import headersclass WacomStore(BaseStore):    def __init__(self):        super().__init__(shop_url='https://wacomstore.com.ua/')        self.items = []    def get_soup(self, link):        response = requests.get(link, headers=headers)        response.raise_for_status()        return BeautifulSoup(response.text, 'lxml')    def generate_info_with_many_links(self, links: list, products_link_locator: str, name_elem_locator: str,                                      price_elem_locator: str, article_elem_locator: str):        return super().generate_info_with_many_links(            links=links, products_link_locator=products_link_locator, name_elem_locator=name_elem_locator,            price_elem_locator=price_elem_locator, article_elem_locator=article_elem_locator)